import React from 'react';
import { useSelector } from 'react-redux';

const Employees = () => {
    const emps = useSelector((state) => state.emps);
    return (
        !emps.length ?
        <div class="spinner-grow" role="status">
            <span class="sr-only">Loading...</span>
        </div>
        :
            <h1> EMplist </h1>
                
    );
}

export default Employees;
